import React from 'react';
// import './HeroSection.css';
import { Link } from 'react-router-dom';
import picspyLogo from '../assets/PicSpyLogoGrand.png';
import background from '../assets/background.jpg';
//HeroSection
function HeroSection() {
  return (
    <div style={{ backgroundImage: `url(${background})` }}>
    <div className="h-screen w-full flex flex-col justify-center items-center object-contain">
      <div className="text-8xl -mt-32">
        <h1>Welcome to PicSpy</h1>
      </div>
      <img
        src={picspyLogo}
        className="max-h-full h-50 object-contain"
        alt="logo"
      />
      <div className="mt-2 text-4xl">
        <p>Challenge yourself to code to find the patterns in the image !</p>

        <p>This web site allows you to create and solve pattern </p>
        <p>detection exercises with images in C++ and Python</p>
      </div>
      <div className="text-3xl hover:text-gray-400">
        <Link to="/challenges">
          <p className="linktochallenge">If you want to start click here!</p>
        </Link>
      </div>
    </div>
    </div>
  );
}

export default HeroSection;
